### 问题描述

场景：
新版QQ不允许保存表情，于是想实现群员引用图片回复“获取链接”，机器人返回图片链接。

1. 我在程序中保存了消息记录，实现了这个功能
2. 1的程序重启后历史数据会丢到就拿不到链接
3. 于是，像通过查询历史消息拿到原消息，再拿到链接
4. 但是，我尝试通过ids过滤查找消息时发现是空的

我不确定这是BUG还是我使用的方法不对。

![image](https://github.com/mamoe/mirai/assets/20937135/e2d60a93-0af8-4f9e-b0aa-3fecfbd56b85)

预期效果：

![image](https://github.com/mamoe/mirai/assets/20937135/8953314c-5797-444e-a672-4587981432c7)


### 复现

```java
MessageChain message = event.getMessage();
        QuoteReply quoteImg = event.getMessage().get(QuoteReply.Key);
        int targetId = quoteImg.getSource().getIds()[0];
//        MessageSource hisMessage = Storage.getHisMessageById(event.getSubject().getId(), quoteImg.getSource().getIds()[0]);
//        if (hisMessage == null) {
//            event.getSubject().sendMessage("没有在历史消息中找到目标！");
//            return false;
//        }
//        Image image = hisMessage.getOriginalMessage().get(Image.Key);
//
//        String imageUrl = Mirai.getInstance().queryImageUrl(event.getBot(), image);
//        event.getSubject().sendMessage(imageUrl);
        
        RoamingMessages roamingMessages = event.getGroup().getRoamingMessages();
        Flow<MessageChain> messages = roamingMessages.getAllMessages(roamingMessage -> {
            log.info("message filter");
            int[] ids = roamingMessage.getIds();
            return targetId == ids[0];
        });
        StringBuilder sb = new StringBuilder();
        messages.collect((singleMessages, continuation) -> {
            List<SingleMessage> messageList = singleMessages.stream().filter(Image.class::isInstance).collect(Collectors.toList());
            messageList.forEach(e->{
                Image img = (Image)e;
                String imageUrl = Mirai.getInstance().queryImageUrl(event.getBot(), img);
                sb.append(imageUrl).append("\n");
            });
            return null;
        }, new Continuation<Unit>() {
            @NotNull
            @Override
            public CoroutineContext getContext() {
                return EmptyCoroutineContext.INSTANCE;
            }

            @Override
            public void resumeWith(@NotNull Object o) {
                log.info("resumeWith - o: {}", o);

            }
        });
        log.info("message");
        if (sb.length() > 0)
            event.getSubject().sendMessage(sb.toString());
```

